Marketing:{title:"Marketing",description:"Wir nutzen diese Cookies, um Ihnen auf Ihre Interessen zugeschnittene Werbung anzuzeigen, innerhalb und au\u00dferhalb der Volkswagen Webseiten.\n\nDiese Cookies sammeln Informationen dar\u00fcber, wie Sie unsere Webseite nutzen, zum Beispiel, welche Seiten Sie am meisten besuchen oder wie Sie sich auf der Seite bewegen. Der Zweck dieser Cookies ist es, Ihnen f\u00fcr Sie relevantere und an Ihre Interessen angepasste Inhalte anzubieten. Sie werden au\u00dferdem dazu verwendet, die Erscheinungsh\u00e4ufigkeit einer Anzeige zu begrenzen und die Effektivit\u00e4t von Kampagnen zu messen und zu steuern. Sie registrieren, ob Sie eine Webseite besucht haben oder nicht, sowie welche Inhalte genutzt worden sind. Dies basiert auf einer eindeutigen Identifikation Ihres Browsers sowie Ihres Internetger\u00e4ts. Die Informationen k\u00f6nnen mit anderen Webseiten oder Seiten Dritter, wie z.B. Volkswagen Konzerngesellschaften oder Werbetreibenden, geteilt werden, sodass Ihnen auch auf anderen Webseiten relevante Werbung angezeigt werden kann. Wir nutzen die Dienste eines Dritten f\u00fcr die Verarbeitung solcher Daten zu Marketing Zwecken. Diese Cookies werden, soweit dies zweckdienlich ist, oftmals mit Seitenfunktionalit\u00e4ten von Dritten verlinkt."},
